import React from "react";

function Video(prop) {
  const videoId = getVideoIdFromUrl(prop.videoObj.url);

  return (

    <div c="card">
      <iframe
        src={`https://www.youtube.com/embed/${videoId}`}
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        title="YouTube video player"
        allowfullscreen height={'300px'}
      ></iframe>
      <div c="card-body">
        <h5 c="card-title">{prop.videoObj.title}</h5>
        <p c="card-text">Requasted At :</p>
        <div cName="buttons">
          <button type="button" c="btn btn-primary"> &#128077; </button>
          <p>{prop.videoObj.rating} </p>
          <button type="button" c="btn btn-warning"> &#128078; </button>
          <button type="button" c="btn btn-danger">
            <i c="fa fa-trash-o"></i>
          </button>
        </div>
      </div>
    </div>
  );
}
export default Video;
function getVideoIdFromUrl(url) {
  const videoId = url.split("v=")[1];
  return videoId;
}
